import { useEffect, useState } from 'react';
import './Register.scss';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { useHistory } from "react-router-dom";
import { toast } from 'react-toastify';
const Register = (props) => {
    const [firtsname, setfirtsname] = useState('');
    const [lastname, setlastname] = useState('');
    const [email, setemail] = useState('');
    const [phone, setphone] = useState('');
    const [address, setaddress] = useState('');
    const [password, setpassword] = useState('');
    const [confirmPassword, setconfirmPassword] = useState('');

    let history = useHistory();
    const handleLogin = () => {
        history.push('/login');
    }
    const handleRegister = () => {
        toast.success("Default Notification !");
    }
    useEffect(() => {

    }, []);
    const isValidInput = () => {
        if (!firtsname) {
            toast.error("Email cannot be blank !");
            return false;
        }
        return true;
    }
    return (
        <div className="login-container">
            <div className="container">
                <div className="row px-3 px-sm-0">
                    <div className="content-left col-12 d-none col-sm-7 d-sm-block ">
                        <div className='brand'>
                            Đăng Ký
                        </div>
                        <div className='detail'>
                            Đăng Ký để trở thành những đàn em của Thế Nguyện cùng nhau kề vai sát cánh trong tương lai ........
                        </div>
                    </div>

                    <div className="content-right col-sm-5 col-12 d-flex flex-column gap-3 py-3">
                        <div className='brand d-sm-none'>
                            Thế Nguyện
                        </div>
                        <div className='form-group'>
                            <label>First Name :</label>
                            <input type='text' className='form-control' placeholder='First Name'
                                value={firtsname} onChange={(event) => setfirtsname(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label>Last Name :</label>
                            <input type='text' className='form-control' placeholder='Last Name'
                                value={lastname} onChange={(event) => setlastname(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label> Email :</label>
                            <input type='email' className='form-control' placeholder='Email address'
                                value={email} onChange={(event) => setemail(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label> PhoneNumber :</label>
                            <input type='number' className='form-control' placeholder='PhoneNumber'
                                value={phone} onChange={(event) => setphone(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label> Address :</label>
                            <input type='text' className='form-control' placeholder='Address'
                                value={address} onChange={(event) => setaddress(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label> Password :</label>
                            <input type='password' className='form-control' placeholder='Password'
                                value={password} onChange={(event) => setpassword(event.target.value)}
                            />
                        </div>
                        <div className='form-group'>
                            <label> RePassword :</label>
                            <input type='password' className='form-control' placeholder='RePassWord'
                                value={confirmPassword} onChange={(event) => setconfirmPassword(event.target.value)}
                            />
                        </div>

                        <button className='btn btn-primary' onClick={() => handleRegister()}>Register</button>
                        <hr />
                        <div className='text-center'>
                            <button className='btn btn-success' onClick={() => handleLogin()}>
                                Already've an account? Login
                            </button>
                        </div>


                    </div>
                </div>
            </div>
        </div>
    )
}
export default Register;
